import React, { useState } from 'react';
import './ContactFormSection.css';
import ReCAPTCHA from 'react-google-recaptcha';

const ContactFormSection = () => {
  const [recaptchaToken, setRecaptchaToken] = useState(null);

 const handleSubmit = async (e) => {
    e.preventDefault();
    // Handle form submission
    // Send token to your backend for verification
    const response = await fetch('http://localhost:5000/api/recaptcha', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ token: recaptchaToken }),
    });
    const data = await response.json();
    if (data.success) {
      console.log('reCAPTCHA verified');
    } else {
      console.log('reCAPTCHA verification failed');
    }
  };

  return (
    <section className="contact-form-section">
      <div className="contact-form-left">
        <h2>Feel Free To Message Us</h2>
        <div className="contact-form-info">
          <div className="contact-form-info-item">
            <i className="fa fa-phone"></i>
            <div>
              <p>Office</p>
              <p>(718)-200-0699</p>
            </div>
          </div>
          <div className="contact-form-info-item">
            <i className="fa fa-mobile-alt"></i>
            <div>
              <p>Cell</p>
              <p>(718)-300-7014</p>
            </div>
          </div>
        </div>
        <p className="contact-form-instruction">Or Please Fill Out Form Below!</p>
        <form onSubmit={handleSubmit}>
          <div className="contact-form-group">
            <input type="text" placeholder="First Name" required />
            <input type="text" placeholder="Last Name" required />
          </div>
          <div className="contact-form-group">
            <input type="email" placeholder="Email Address" required />
            <input type="tel" placeholder="Phone Number" required />
          </div>
          <div className="contact-form-group">
            <textarea placeholder="Type Your Message Here..." required></textarea>
          </div>
          <div className="contact-form-recaptcha-container">
            <ReCAPTCHA
              sitekey="6LegA-gpAAAAAGW9Z33294_uD3awWEU1zhIPuGwXY"
              onChange={(token) => setRecaptchaToken(token)}
            />
            </div>
          <button type="submit">Send Us A Message</button>
        </form>
      </div>
      <div className="contact-form-right">
        <h2>Our Locations</h2>
        <div className="contact-form-location">
          <i className="fa fa-map-marker-alt"></i>
          <div>
            <p>BROOKLYN OFFICE:</p>
            <p>2855 Cropsey Ave Brooklyn, NY 11214</p>
          </div>
        </div>
        <div className="contact-form-map">
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3021.9902533893615!2d-73.98940238459363!3d40.58645197934544!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89e8996c841ff87b%3A0xe755a1e1f4e8a08b!2s2855%20Cropsey%20Ave%2C%20Brooklyn%2C%20NY%2011214%2C%20USA!5e0!3m2!1sen!2sin!4v1639447365267!5m2!1sen!2sin"
            width="100%"
            height="300"
            style={{ border: '0' }}
            allowFullScreen=""
            loading="lazy"
            title="Brick Tech Contracting Corp Location"
          ></iframe>
        </div>
      </div>
    </section>
  );
};

export default ContactFormSection;
